    // 快捷键
    var inputElement = document.getElementById("chatgpt_input")
    inputElement.addEventListener('keydown',function(e){
      e = e || window.event;
      let keyCode = e.keyCode || e.which || e.charCode;
      let ctrlKey = e.ctrlKey || e.metaKey;
      if( ctrlKey && keyCode == 13){
        document.getElementById("chatgpt_input").value = 
        document.getElementById("chatgpt_input").value + "\n";
      }else if(keyCode == 13){
        e.preventDefault()
        document.getElementById("insquery").click()
      }
    })